import React from "react";
import Slider from "react-slick";
import Left from '../assets/images/left.svg';
import Right from '../assets/images/right.svg';

function SampleNextArrow(props : any) {
    const {  onClick } = props;
    return (
        <button
            className='customNext'
            onClick={onClick}
        >
            <img src={Right} alt={'left'} width={20}/>
        </button>
    );
}

function SamplePrevArrow(props : any) {
    const { onClick } = props;
    return (
        <button
            className='customPrev'
            onClick={onClick}
        >
            <img src={Left} alt={'left'} width={20}/>
        </button>
    );
}

function CustomSlider() {
    const settings = {
        dots: true,
        infinite: true,
        vertical: true,
        verticalSwiping: true,
        slidesToShow: 3,
        slidesToScroll: 1,
        nextArrow: <SampleNextArrow />,
        prevArrow: <SamplePrevArrow />
    };
    return (
        <div className="h-full">
            <Slider {...settings}>
                <div className='w-[200px] h-[120px] bg-white border rounded-xl mb-8 mx-8'>
                    <h3>1</h3>
                </div>
                <div className='w-[400px] h-[120px] bg-white border rounded-xl mb-8'>
                    <h3>2</h3>
                </div>
                <div className='w-[400px] h-[120px] bg-white border rounded-xl mb-8'>
                    <h3>3</h3>
                </div>
                <div className='w-[400px] h-[120px] bg-white border rounded-xl mb-8'>
                    <h3>4</h3>
                </div>
            </Slider>
        </div>
    );
}

export default CustomSlider;
